 to crypto news and tips for anyone who wants to learn blockchain technology. In these videos, originally streamed live on YouTube, Gün kicks back and speaks his mind on a variety of cryptocurrency and blockchain news topics, including:\n- The growth of Bitcoin (BTC)\n- His participation in the recent Medici LA Conference\n- Traditional finance (TradFi) and cryptocurrency\n- His teaching philosophy\n- The bull market of 2020\n- Solana vs. Avalanche\n- Digitizing global assets\n- Reimagining Wall Street with AVAX\n- Sharding in crypto\n- The state of graduate education in the field\n- Introduction to subnets\n- The failure of the EOS blockchain protocol\n- Meme coins and similar trends\n- SnowTrace (Etherscan for Avalanche blockchain)\n- Decentralized autonomous organizations (DAOs)\n- Facebook's Metaverse\n- Subnets vs. optimistic rollups\n- The purpose of AVAX\n- Russia's Federal Security Service and its attempts to crack down on crypto\n- Why AVAX is not an Ethereum killer\n- Wealth generation: proof of work (PoW) vs. proof of stake (PoS)\n- Microsoft browser tracking\n- AVAX offered on Coinbase Pro in New York\n- EVMs\n- Avalanche and the Metaverse  \n\nThis is an excellent opportunity to learn from one of the leading authorities in crypto as he discusses Avalanche news, developments in the world of blockchain, and other relevant current topics of interest. Gün also answers questions from viewers. And best of all, this trove of information is offered to viewers entirely free of charge. \n\nPlease check back often for new installments in this ongoing series. For the latest in Avalanche (AVAX) news, please visit https://www.avax.network/press. \n\nABOUT EMIN GÜN SIRER\nOne of the world's leading experts in blockchain technology, Emin Gün Sirer earned his bachelor's degree at Princeton University and went on to receive a Ph.D. in Computer Science and Engineering from the University of Washington (2002). His doctorate thesis was “Secure, Efficient and Manageable Virtual Machine Systems.” \nFollowing graduation, Sirer found employment at AT\u0026T Bell Labs (where he worked on the Plan 9 distributed operating system), DEC Systems Research Center, and NEC Corporation.\n\nSirer has been heavily involved with cryptocurrency technology since the early 2000s. Working with various collaborators, he has published dozens of influential papers on topics such as Bitcoin, wireless data centers, HyperDex, Nexus, device driver safety, P2P protocols, Java, and other subjects. He appears regularly at tech conferences and symposiums around the world.\n\nIn 2001, Sirer joined the faculty of Cornell University. He has been affiliated with the Information Assurance Institute, the Institute for Information Infrastructure Protection, the Griffiss Institute, the Cornell Faculty Advisory Board on Information Technology, Initiative for Cryptocurrencies and Smart Contracts, the Team for Research in Ubiquitous Secure Technology (TRUST), and PlanetLab.\nIn 2017, Sirer co-founded the blockchain distribution network BloXroute Lab. He founded Ava Labs in 2018 and still serves as the company's CEO."},"trackingParams":"CNoEENwcGAAiEwiyv4Cn_8mKAxWx1D8EHRXfKb0=","playAllButton":{"buttonRenderer":{"style":"STYLE_TEXT","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Play all"}]},"icon":{"iconType":"PLAY_ALL"},"navigationEndpoint":{"clickTrackingParams":"CNsEEPBbIhMIsr-Ap__JigMVsdQ_BB0V3ym9","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=TqkRFHdpkyA\u0026list=PLRHl-ulWK4-EiCSYSEhu-yTsnAEWk0e3g","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"TqkRFHdpkyA","playlistId":"PLRHl-ulWK4-EiCSYSEhu-yTsnAEWk0e3g","loggingContext":{"vssLoggingContext":{"serializedContextData":"GiJQTFJIbC11bFdLNC1FaUNTWVNFaHUteVRzbkFFV2swZTNn"}},"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr4---sn-p5qddn7k.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad= ra Capital)\nNicole Tay (Skynet Labs)   \nTony Pham (Kadena)   \nAnish Shah (Bring Ruckus)\nEric Wall (Arcane Assets)\nSergey Nazarov (Chainlink)\nHaider Rafique (OKCoin)\nDawn Song (Oasis Labs)\nArthur Breitman (Tezos)\nSteve Kokinos (Algorand)\nZach Seward (CoinDesk)\nBjorn Wagner (Polkadot)\nAlex Skidanov (NEAR Protocol)\nTopics under discussion include the following:\nHow Avalanche achieves almost instantaneous transaction finality\nEthereum vs. Avalanche  \nHow Avalanche’s consensus mechanism works and why it’s unique \nWhy ILOs are better on blockchain\nHow Avalaunch works on the Avalanche platform  \nThe future of DeFi\nThe Avalanche community and how it operates\nScaling global crypto communities\nTips for building on blockchain\nMarketing in crypto and blockchain\nThe usefulness of decentralized oracles in the Avalanche consensus\nThe impact of distributed technologies on the business world\nEthereum 2.0\nProblems with cross-chain blockchain interoperability\nOpen and programmable finance with Avalanche\nApricot Phase Four\nEnterprise subnets\nUsing DeFi on Avalanche\t\nHow to connect Avalanche to a MetaMask wallet\nSending AVAX from an exchange to your MetaMask wallet\t\nDepositing AVAX on Coinbase Pro \t\nStaking AVAX via delegation \t\nCreating a new Avalanche wallet  \t\nHow you can obtain AVAX  \t\nHow to evaluate blockchain projects  \t\nWhether you’re interested in building on Avalanche or are simply curious about the latest news in blockchain technology, this series of videos will answer many of your questions. \nMore videos will be added on a rolling basis. Please check back often for updates.\nAvalanche is a fast, low-cost, and eco-friendly platform. The thriving Avalanche community includes working professionals from the worlds of decentralized finance, art collecting, and private industry. For further information about the Avalanche blockchain, please visit the sites listed below. \n\nAvalanche Resources:\nWebsite: https://www.avax.network ​\nEcosystem: https://ecosystem.avax.network\nTwitter: https://twitter.com/avalancheavax\nDiscord: https://chat.avax.network"},"trackingParams":"CJgEENwcGAAiEwiyv4Cn_8mKAxWx1D8EHRXfKb0=","playAllButton":{"buttonRenderer":{"style":"STYLE_TEXT","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Play all"}]},"icon":{"iconType":"PLAY_ALL"},"navigationEndpoint":{"clickTrackingParams":"CJkEEPBbIhMIsr-Ap__JigMVsdQ_BB0V3ym9","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=_u9J4Ex_oa4\u0026list=PLRHl-ulWK4-HfWw4-M5sZe12xHLC1i_Ie","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"_u9J4Ex_oa4","playlistId":"PLRHl-ulWK4-HfWw4-M5sZe12xHLC1i_Ie","loggingContext":{"vssLoggingContext":{"serializedContextData":"GiJQTFJIbC11bFdLNC1IZld3NC1NNXNaZTEyeEhMQzFpX0ll"}},"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr3---sn-p5qddn7z.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oavd=11000\u0026ocs=700\u0026oewis=1\u0026oputc=1\u0026ofpcc=1\u0026msp=1\u0026odepv=1\u0026id=feef49e04c7fa1ae\u0026ip=174.60.89.161\u0026initcwndbps=4391250\u0026mt=1735372374\u0026oweuc="}}}}},"trackingParams":"CJkEEPBbIhMIsr-Ap__JigMVsdQ_BB0V3ym9"}}}}],"trackingParams":"CJcEELsvGAMiEwiyv4Cn_8mKAxWx1D8EHRXfKb0="}},{"itemSectionRenderer":{"contents":[{"shelfRenderer":{"title":{"runs":[{"text":"Avalanche: Developers","navigationEndpoint":{"clickTrackingParams":"CNYDENwcGAAiEwiyv4Cn_8mKAxWx1D8EHRXfKb0=","commandMetadata":{"webCommandMetadata":{"url":"/playlist?list=PLRHl-ulWK4-H3bjQWaTE-NU45HIPQ-PUb","webPageType":"WEB_PAGE_TYPE_PLAYLIST","rootVe":5754,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"VLPLRHl-ulWK4-H3bjQWaTE-NU45HIPQ-PUb"}}}]},"endpoint":{"clickTrackingParams":"CNYDENwcGAAiEwiyv4Cn_8mKAxWx1D8EHRXfKb0=","commandMetadata":{"webCommandMetadata":{"url":"/playlist?list=PLRHl-ulWK4-H3bjQWaTE-NU45HIPQ-PUb","webPageType":"WEB_P Data integrity - The immutability and publicly accessible nature of blockchain data resists tampering from threat actors who might attempt to falsify transactions.\n- No need for central authority - Smart contracts can function without the need for a third-party entity (e.g., bank) that governs it.\n- Prevents internet censorship - The consensus mechanism allows users to execute transactions without fear of being blocked by a single adversarial entity. \n- No single point of failure - Because dapps don't rely on a centralized server or entity, the collapse of the system is extremely unlikely.\nTransparency - Dapp data is accessible to the public, fostering trust in the process.\n\nDapp development will be an increasingly vital field in the years to come, but it can be tricky to learn the ins and outs of programming decentralized apps. Building dapps is not an exercise for beginners. Fortunately, the team at Ava Labs is here to help. \n\nIn just over a year since its arrival, Avalanche has attracted the interest of thousands of dapp developers who see the enormous potential of this platform. With them in mind, the Avalanche platform presents a collection of informative videos on various topics relating to dapp development, as explained by some of today’s leading experts in decentralized applications. Participants include blockchain experts from Ava Labs, Chainlink, Aave, Trader Joe, StakeDAO, Pangolin, and many other organizations.\n\nIn these videos, you will find a wealth of up-to-date information on Avalanche, blockchains, building a dapp on Ethereum, general dapp development, financial primitives, subnets, virtual machines, and many other topics of interest to the modern cryptocurrency professional or enthusiast. If you have any desire to create dapps, or just want to be better informed on the topic, these videos provide a deep dive into this exciting world. Be sure to check back periodically for new videos uploaded to this playlist.\n\nAvalanche is here to help r, if you’re new to the world of blockchain and cryptocurrency, it’s likely that you have questions about how this technology works. The good news is that it’s not difficult to get started in this exciting new field—but it’s best to learn a few things before you begin. \nWith that in mind, contributors to  Avalanche have put together a playlist of informative videos that touch on AVAX (Avalanche’s native token), navigating around the platform, and other topics of interest to the blockchain novice or even experienced users who need guidance on one or more specific aspects of this relatively new field. \nThe tutorial videos in this section cover a wide variety of topics, including:\nWhere to buy AVAX\nA history of blockchains: Bitcoin, Ethereum, and more\nSending AVAX from an exchange to MetaMask via C-Chain withdrawal\nSwapping tokens on SushiSwap using the Avalanche platform\nStaking your AVAX by delegating to a validator\nSending AVAX from an exchange to Avalanche Wallet\nHow to create a crypto wallet\nUsing the Avalanche Wallet to create a new wallet\nUsing the Avalanche Wallet to access an existing wallet\nUsing a custom RPC (Remote Procedure Call) to connect Avalanche to MetaMask\nWhat to do if Avalanche Wallet mistakenly shows no balance\nDiagnosing cross-chain transfer issues with the Avalanche Wallet\nAccessing your wallet with the Save Account feature\nA brief introduction to Pangolin, a new distributed exchange on Avalanche\nHow to swap tokens on Pangolin\nHow to set up MetaMask on Pangolin\nHow to set up an Avalanche node\nTips for maintaining and upgrading your Avalanche node\nHow to check the status of your Avalanche node\nHow to download and install Postman\nDelegating and validating AVAX\nRunning an Avalanche node at home with a virtual machine\nUsing Figment to connect MetaMask to Avalanche\nStaking AVAX on AVADO\nDepositing AVAX into a Coinbase Pro account\nWithdrawing AVAX from a Coinbase Pro account\nUsing DeFi on Avalanche\nFarming pool tokens to oes with other blockchain assets. Because NFTs exist in publicly accessible blockchains, their content can be copied by others—however, users will always know which one was the original.\n\nThere have been several high-profile sales of NFT assets recently, such as Jack Dorsey's first Tweet (sold for $2.9 million at auction) and several previously unseen scenes from Quentin Tarantino's film Pulp Fiction. NFTs of these kinds tend to function much as collectibles in the art world, purchased by buyers who hope to make a profit on future increases in value. However, the uses of NFTs, both potential and currently realized, extend far beyond this.\n\nExamples of NFTs currently in existence include:   \n- Digital artwork \t\n- Domain names\t\n- Event tickets\t\n- Coupons\n- Internet memes\t\n- Motion pictures\n- Music scores\n- Video clips\n- Video game items\n\nIt is certain that the applications of NFT technology will expand into new areas in the near future. \n\nIf you want to learn how to create an NFT, now is the ideal time. This is an exciting trend in decentralized technology that has huge game-changing potential, both in the private and the public sector. And, Avalanche can help you harness the power of NFT assets. Here’s a collection of videos about this fast-rising trend in the blockchain world.\n \nThe videos in this section provide an informative overview of NFTs while exploring the utility of these tokens as investment options and personal keepsakes, among other uses. \n\nParticipants include speakers from Ava Labs, FTX, Chainlink, Solana, and other notable organizations involved in decentralized tech.\nWith Avalanche, NFT creators have the tools needed to create these tokens with minimal expenditure of time and energy. To learn more, please visit Avalanche’s website at https://www.avax.network/."},"trackingParams":"CJACENwcGAAiEwiyv4Cn_8mKAxWx1D8EHRXfKb0=","playAllButton":{"buttonRenderer":{"style":"STYLE_TEXT","size":"SIZE_DEFAULT","isDisabled":false,"text":{
